;; **
;;; # Matching triangle, and other shapes
;;; 
;;; 
;; **

;; @@
(ns stark-spring
 (:require
   [opencv3.utils :as u]
   [opencv3.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def t1 
  (->
  "resources/white-blue-triangle.png"
  (imread)
  (u/resize-by 0.2) ))

(u/mat-view t1)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"165\" height=\"165\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x68b3e5a9 \"BufferedImage@68b3e5a9: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@576ad4d9 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 165 height = 165 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@

(def t2
  (->
   "resources/Sweden_road_sign_A19-1.svg.png"
   (imread)
   (u/resize-by 0.7) ))

(u/mat-view t2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"154\" height=\"136\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x10d8a15 \"BufferedImage@10d8a15: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@576ad4d9 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 154 height = 136 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def lower-red  (new-scalar 70 20 20))
(def upper-red  (new-scalar 100 255 255))
(def mask (new-mat))
(in-range (-> t2 clone (cvt-color! COLOR_RGB2HSV)) lower-red upper-red mask)
(u/mat-view mask)

;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"154\" height=\"136\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4b9e226 \"BufferedImage@4b9e226: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@c0757ad transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 154 height = 136 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@

(def contours (new-arraylist))
(find-contours mask contours (new-mat) RETR_LIST CHAIN_APPROX_SIMPLE)

(def indexed  
    (apply hash-map (flatten (map-indexed (fn [idx itm] [idx itm]) contours ))))

(def sorted  
    (into 
      (sorted-map-by 
      (fn [key1 key2]
       (clojure.core/compare  
        (-> (get indexed key1) (.size) (.area))
        (-> (get indexed key2) (.size) (.area))))) 
                   indexed))

(def biggest (last sorted))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;opencv3.matchingshapes/biggest</span>","value":"#'opencv3.matchingshapes/biggest"}
;; <=

;; @@
(def output 
  (new-mat (.rows mask) (.cols mask) CV_8UC3 (new-scalar 0 0 0)))

(draw-contours output contours (key biggest)  (new-scalar 255 255 255) 3)

(u/mat-view output)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"154\" height=\"136\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1948942c \"BufferedImage@1948942c: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@576ad4d9 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 154 height = 136 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def s1 
  (-> t1 clone (cvt-color! COLOR_BGR2GRAY) (threshold! 210 240 1)))
(def s2 
  (-> output clone (cvt-color! COLOR_BGR2GRAY) (threshold! 210 240 1)))

(match-shapes (.t s1) (.t s2) CV_CONTOURS_MATCH_I1 0)

